import React from 'react';
import Form from '../atoms/Form/Form';
import Fields from '../atoms/Form/Fields';

function FormLogin() {
    return (
        <Form>
            <div className="space-y-3" >
                <Fields type="text" name="email" label="email" />
            </div>
        </Form>
    );
}

export default FormLogin;
